import * as React from 'react';
import { Button, View, Text, TextInput, StatusBar, StyleSheet} from 'react-native';

function SchedulingSetTimerScreen({ navigation }) {
    const [Text_Minutes, setText_Minutes] = React.useState('');
    
    return (
      <View style={styles.Set_Timer}>
      <StatusBar barStyle="dark-content" backgroundColor="#ecf0f1" />
        <Text>Set Timer</Text>
   
        <Text> Minutes:</Text>
        <TextInput
            value={Text_Minutes}
            onChangeText={setText_Minutes}
            keyboardType = {'numeric'}
        />
        
   
        <Button
          title="Start Now"
          onPress={() => navigation.push('CountDown', Text_Minutes)}
        />
      </View>
    );
  }

  const styles = StyleSheet.create({
    Set_Timer: {
      flex: 1,
      alignItems: 'center', 
      justifyContent: 'center'
    }
});

  export default SchedulingSetTimerScreen;
